// change tab icon with encoded base64 svg of specific YouTube logo
const link = document.createElement('link');
link.rel = 'icon';
link.type = 'image/svg+xml';
if (document.URL.includes("music.youtube")) {
    // YouTube music tab icon svg base64 encoded
    link.href = 'data:image/svg+xml;base64,';
} else if (document.URL.includes("studio.youtube")) {
    // YouTube studio tab icon svg base64 encoded
    link.href = 'data:image/svg+xml;base64,';
} else {
    // regular YouTube tab icon svg base64 encoded
    link.href = 'data:image/svg+xml;base64,'; // YouTube logo 2017 svg from wikipedia
}
// to remove any other icon images in the page before replacing them with the svg image
document.querySelectorAll('link[rel="icon"]').forEach(icon => icon.remove());
// update tab icon
document.head.appendChild(link);
